import React, { useState } from 'react';
import { FaUser } from 'react-icons/fa';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

function Profile() {

  //add user details


  const [formData, setFormData] = useState({
    fullName: '',
    address: '',
    dob: '',
    nic: '',
    telephone: '',
    weight: '',
    height: ''
  });

  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value,
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const token = localStorage.getItem('usersdatatoken');

    const response = await fetch('/user/profile', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        Authorization: token,
      },
      body: JSON.stringify(formData),
    });

    const data = await response.json();
    console.log(data);
  };

  //calender
  const [date, setDate] = useState(new Date());
  const [showPopup, setShowPopup] = useState(false);

  const handleDateChange = (date) => {
    setDate(date);
  };

  const handlePopup = () => {
    setShowPopup(!showPopup);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  return (
    <div className='bg-white flex rounded-lg'>
      {/* First Part */}
      <div className='w-3/4 rounded-l-lg bg-red-500 p-8 min-h-screen'>
        <div className='flex justify-center items-center mb-8'>
          <FaUser className='text-4xl mr-4' />
          <h1 className='text-4xl font-bold'>Profile Details</h1>
        </div>
        <div>
          <p className='text-gray-600 mb-2'>Name: </p>
          <input type='text' className='w-full border border-gray-300 rounded-md p-2 mb-4' />
          <p className='text-gray-600 mb-2'>Address: </p>
          <input type='text' className='w-full border border-gray-300 rounded-md p-2 mb-4' />
          <button className='bg-blue-500 text-white font-bold py-2 px-4 rounded'>Update</button>
        </div>
      </div>
      {/* Second Part */}
      <div className='w-1/4 rounded-r-lg bg-white p-8'>
        <div className='flex flex-col justify-center items-center'>
          <div className='w-24 h-24 rounded-full bg-gray-400 mb-4'></div>
          <Calendar value={date} onChange={handleDateChange} />
          <button className='bg-blue-500 text-white font-bold py-2 px-4 rounded mt-4' onClick={handlePopup}>Add Data</button>
          {showPopup && (
           <div className='fixed inset-0 z-10 overflow-y-auto bg-black bg-opacity-50'>
           <div className='flex items-center justify-center min-h-screen'>
           <div class="w-72 h-64 p-4 bg-white rounded-lg shadow-md">
  <h2 class="text-lg font-medium mb-4">Personal Information</h2>
  <form>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="fullName">Full Name</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="fullName" name="fullName" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="address">Address</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="address" name="address" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="dob">Date of Birth</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="dob" name="dob" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="nic">NIC</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="nic" name="nic" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="telephone">Telephone</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="telephone" name="telephone" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="weight">Weight</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="weight" name="weight" />
    </div>
    <div class="mb-4">
      <label class="block text-gray-700 font-medium mb-2" for="height">Height</label>
      <input class="border rounded-lg px-3 py-2 w-full" type="text" id="height" name="height" />
    </div>
    <button class="bg-blue-500 text-white font-medium px-4 py-2 rounded-lg hover:bg-blue-600" type="submit">Submit</button>
  </form>
</div>

           </div>
         </div>
          )}
          <button className='bg-blue-500 text-white font-bold py-2 px-4 rounded mt-2'>Update Data</button>
        </div>
      </div>
    </div>
  );
}

export default Profile;
